description:
Landing gear juts out, the servos whir loudly as the wheels protract out to break our descent. Gravity takes hold. The thud of metal and rubber hitting asphalt meant that we had at least gotten to ground—the aerodynamic bullet in the sky begins to slow itself as it eats away at the stretch of road it has left. 
///
Landed in Barcelona, it was one of the first times I could remember getting shuttled from plane to terminal.
